$.b1n=A.a(["\u062a\u0633\u062a\u0646\u062f \u0627\u0644\u0644\u0639\u0628\u0629 \u0625\u0644\u0649 \u0627\u0633\u062a\u0646\u062a\u0627\u062c\u0627\u062a \u0623\u0631\u0633\u0637\u0648 \u0648\u0642\u064a\u0627\u0633\u0627\u062a\u0647 \u0627\u0644\u0645\u0646\u0637\u0642\u064a\u0629\u060c \u0648\u0647\u064a \u062d\u062c\u062c \u0645\u0646\u0637\u0642\u064a\u0629 \u062a\u0633\u062a\u062e\u062f\u0645 \u0627\u0644\u0627\u0633\u062a\u0646\u062a\u0627\u062c \u0644\u0644\u0648\u0635\u0648\u0644 \u0625\u0644\u0649 \u0646\u062a\u064a\u062c\u0629 \u0628\u0646\u0627\u0621\u064b \u0639\u0644\u0649 \u0645\u0642\u062f\u0645\u062a\u064a\u0646. \u064a\u0643\u0648\u0646 \u0627\u0644\u0642\u064a\u0627\u0633 \u0635\u062d\u064a\u062d\u064b\u0627 \u0625\u0630\u0627 \u0643\u0627\u0646\u062a \u0627\u0644\u0646\u062a\u064a\u062c\u0629 \u062a\u062a\u0628\u0639 \u0645\u0646\u0637\u0642\u064a\u0627\u064b \u0645\u0646 \u0627\u0644\u0645\u0642\u062f\u0645\u0627\u062a.","\u8be5\u6e38\u620f\u57fa\u4e8e\u4e9a\u91cc\u58eb\u591a\u5fb7\u7684\u63a8\u8bba\u548c\u4e09\u6bb5\u8bba\uff0c\u8fd9\u662f\u901a\u8fc7\u6f14\u7ece\u63a8\u7406\u6839\u636e\u4e24\u4e2a\u524d\u63d0\u5f97\u51fa\u7ed3\u8bba\u7684\u903b\u8f91\u8bba\u8bc1\u3002\u5982\u679c\u7ed3\u8bba\u903b\u8f91\u4e0a\u7b26\u5408\u524d\u63d0\uff0c\u5219\u4e09\u6bb5\u8bba\u6709\u6548\u3002","Das Spiel basiert auf aristotelischen Schlussfolgerungen und Syllogismen, bei denen es sich um logische Argumente handelt, die deduktives Denken anwenden, um auf der Grundlage zweier Pr\xe4missen zu einer Schlussfolgerung zu gelangen. Ein Syllogismus ist g\xfcltig, wenn die Schlussfolgerung logisch aus den Pr\xe4missen folgt.","The game is based on Aristotelian deductions and syllogisms, which are logical arguments that apply deductive reasoning to arrive at a conclusion based on two premises. A syllogism is valid if the conclusion follows logically from the premises.","Le jeu est bas\xe9 sur les d\xe9ductions aristot\xe9liciennes et les syllogismes, qui sont des arguments logiques appliquant le raisonnement d\xe9ductif pour arriver \xe0 une conclusion bas\xe9e sur deux pr\xe9misses. Un syllogisme est valide si la conclusion suit logiquement les pr\xe9misses.","\u092f\u0939 \u0916\u0947\u0932 \u0905\u0930\u0938\u094d\u0924\u0942 \u0915\u0947 \u0928\u093f\u0937\u094d\u0915\u0930\u094d\u0937\u094b\u0902 \u0914\u0930 \u0928\u093f\u0917\u092e\u0928 \u0935\u093f\u0927\u093f \u092a\u0930 \u0906\u0927\u093e\u0930\u093f\u0924 \u0939\u0948, \u091c\u094b \u0915\u093f \u0926\u094b \u092a\u094d\u0930\u0938\u094d\u0924\u093e\u0935\u094b\u0902 \u0915\u0947 \u0906\u0927\u093e\u0930 \u092a\u0930 \u0928\u093f\u0937\u094d\u0915\u0930\u094d\u0937 \u0924\u0915 \u092a\u0939\u0941\u0901\u091a\u0928\u0947 \u0915\u0947 \u0932\u093f\u090f \u0924\u0930\u094d\u0915 \u0915\u093e \u0909\u092a\u092f\u094b\u0917 \u0915\u0930\u0924\u093e \u0939\u0948\u0964 \u092f\u0926\u093f \u0928\u093f\u0937\u094d\u0915\u0930\u094d\u0937 \u092a\u094d\u0930\u0938\u094d\u0924\u093e\u0935\u094b\u0902 \u0938\u0947 \u0924\u093e\u0930\u094d\u0915\u093f\u0915 \u0930\u0942\u092a \u0938\u0947 \u0906\u0924\u093e \u0939\u0948, \u0924\u094b \u0928\u093f\u0917\u092e\u0928 \u0935\u093f\u0927\u093f \u092e\u093e\u0928\u094d\u092f \u0939\u0948\u0964","\u3053\u306e\u30b2\u30fc\u30e0\u306f\u30a2\u30ea\u30b9\u30c8\u30c6\u30ec\u30b9\u306e\u63a8\u8ad6\u3068\u4e09\u6bb5\u8ad6\u6cd5\u306b\u57fa\u3065\u3044\u3066\u304a\u308a\u3001\u3053\u308c\u306f2\u3064\u306e\u524d\u63d0\u306b\u57fa\u3065\u3044\u3066\u7d50\u8ad6\u306b\u5230\u9054\u3059\u308b\u305f\u3081\u306b\u6f14\u7e79\u7684\u63a8\u8ad6\u3092\u9069\u7528\u3059\u308b\u8ad6\u7406\u7684\u306a\u8b70\u8ad6\u3067\u3059\u3002\u7d50\u8ad6\u304c\u524d\u63d0\u304b\u3089\u8ad6\u7406\u7684\u306b\u5c0e\u304d\u51fa\u3055\u308c\u308b\u5834\u5408\u3001\u4e09\u6bb5\u8ad6\u6cd5\u306f\u6709\u52b9\u3067\u3059\u3002","O jogo \xe9 baseado nas dedu\xe7\xf5es aristot\xe9licas e nos silogismos, que s\xe3o argumentos l\xf3gicos que aplicam o racioc\xednio dedutivo para chegar a uma conclus\xe3o com base em duas premissas. Um silogismo \xe9 v\xe1lido se a conclus\xe3o seguir logicamente das premissas.","El juego se basa en las deducciones aristot\xe9licas y los silogismos, que son argumentos l\xf3gicos que aplican el razonamiento deductivo para llegar a una conclusi\xf3n basada en dos premisas. Un silogismo es v\xe1lido si la conclusi\xf3n sigue l\xf3gicamente de las premisas."],t.s)
$.b1o=A.a(["\u0633\u062a\u0639\u0631\u0636 \u0644\u0643 \u0627\u0644\u0644\u0639\u0628\u0629 \u0642\u064a\u0627\u0633\u064b\u0627 \u0645\u0646\u0637\u0642\u064a\u064b\u0627 \u0623\u0648 \u0627\u0633\u062a\u0646\u062a\u0627\u062c\u064b\u0627\u060c \u0648\u0639\u0644\u064a\u0643 \u062a\u062d\u062f\u064a\u062f \u0623\u064a \u0645\u0646 \u0627\u0644\u062e\u064a\u0627\u0631\u0627\u062a \u0623\u062f\u0646\u0627\u0647 \u0635\u062d\u064a\u062d.","\u6e38\u620f\u5c06\u4e3a\u60a8\u5448\u73b0\u4e00\u4e2a\u4e09\u6bb5\u8bba\u6216\u63a8\u8bba\uff0c\u60a8\u9700\u8981\u786e\u5b9a\u4ee5\u4e0b\u9009\u9879\u4e2d\u54ea\u4e2a\u662f\u6709\u6548\u7684\u3002","Das Spiel wird Ihnen einen Syllogismus oder eine Schlussfolgerung pr\xe4sentieren, und Sie m\xfcssen bestimmen, welche der untenstehenden Optionen g\xfcltig ist.","The game will present you with a syllogism or a deduction, and you will have to determine which one of the options below is valid.","Le jeu vous pr\xe9sentera un syllogisme ou une d\xe9duction, et vous devrez d\xe9terminer laquelle des options ci-dessous est valide.","\u0916\u0947\u0932 \u0906\u092a\u0915\u094b \u090f\u0915 \u0928\u093f\u0917\u092e\u0928 \u0935\u093f\u0927\u093f \u092f\u093e \u0928\u093f\u0937\u094d\u0915\u0930\u094d\u0937 \u092a\u094d\u0930\u0938\u094d\u0924\u0941\u0924 \u0915\u0930\u0947\u0917\u093e, \u0914\u0930 \u0906\u092a\u0915\u094b \u092f\u0939 \u0928\u093f\u0930\u094d\u0927\u093e\u0930\u093f\u0924 \u0915\u0930\u0928\u093e \u0939\u094b\u0917\u093e \u0915\u093f \u0928\u0940\u091a\u0947 \u0926\u093f\u090f \u0917\u090f \u0935\u093f\u0915\u0932\u094d\u092a\u094b\u0902 \u092e\u0947\u0902 \u0938\u0947 \u0915\u094c\u0928 \u0938\u093e \u092e\u093e\u0928\u094d\u092f \u0939\u0948\u0964","\u30b2\u30fc\u30e0\u306f\u3042\u306a\u305f\u306b\u4e09\u6bb5\u8ad6\u6cd5\u307e\u305f\u306f\u63a8\u8ad6\u3092\u63d0\u793a\u3057\u3001\u4ee5\u4e0b\u306e\u30aa\u30d7\u30b7\u30e7\u30f3\u306e\u3046\u3061\u3069\u308c\u304c\u6709\u52b9\u304b\u3092\u5224\u65ad\u3059\u308b\u5fc5\u8981\u304c\u3042\u308a\u307e\u3059\u3002","O jogo apresentar\xe1 a voc\xea um silogismo ou uma dedu\xe7\xe3o, e voc\xea ter\xe1 que determinar qual das op\xe7\xf5es abaixo \xe9 v\xe1lida.","El juego te presentar\xe1 un silogismo o una deducci\xf3n, y tendr\xe1s que determinar cu\xe1l de las opciones a continuaci\xf3n es v\xe1lida."],t.s)
$.b1p=A.a(['\u2022 \u0644\u0644\u062a\u062d\u0642\u0642 \u0645\u0646 \u0627\u0644\u0635\u062d\u0629\u060c \u0627\u062e\u062a\u0631 \u0627\u0644\u062e\u064a\u0627\u0631\u0627\u062a \u0648\u0627\u0636\u063a\u0637 \u0639\u0644\u0649 \u0632\u0631 "\u062a\u062d\u0642\u0642".',"\u2022 \u82e5\u8981\u9a8c\u8bc1\uff0c\u8bf7\u9009\u62e9\u9009\u9879\u5e76\u6309\u4e0b\u201c\u9a8c\u8bc1\u201d\u6309\u94ae\u3002","\u2022 Um die G\xfcltigkeit zu \xfcberpr\xfcfen, w\xe4hlen Sie die Optionen und dr\xfccken Sie die Schaltfl\xe4che \u201e\xdcberpr\xfcfen\u201c.",'\u2022 To verify, select the options and press the "Verify" button.','\u2022 Pour v\xe9rifier, s\xe9lectionnez les options et appuyez sur le bouton "V\xe9rifier".','\u2022 \u0938\u0924\u094d\u092f\u093e\u092a\u0928 \u0915\u0947 \u0932\u093f\u090f, \u0935\u093f\u0915\u0932\u094d\u092a \u091a\u0941\u0928\u0947\u0902 \u0914\u0930 "\u0938\u0924\u094d\u092f\u093e\u092a\u093f\u0924 \u0915\u0930\u0947\u0902" \u092c\u091f\u0928 \u0926\u092c\u093e\u090f\u0902\u0964',"\u2022 \u691c\u8a3c\u3059\u308b\u306b\u306f\u3001\u30aa\u30d7\u30b7\u30e7\u30f3\u3092\u9078\u629e\u3057\u3001\u300c\u78ba\u8a8d\u300d\u30dc\u30bf\u30f3\u3092\u62bc\u3057\u3066\u304f\u3060\u3055\u3044\u3002",'\u2022 Para verificar, selecione as op\xe7\xf5es e pressione o bot\xe3o "Verificar".','\u2022 Para verificar, selecciona las opciones y presiona el bot\xf3n "Verificar".'],t.s)
